script: |
  super -f text -I q6464.spq | sort > q6464.out

inputs:
  - name: q6464.spq
    data: |
      SELECT - col1 + - col0 * + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) <= NULL OR - col1 NOT IN ( + col1 );
  - name: tab2

outputs:
  - name: q6464.out
    data: |
      -6143
      -6258
      -80
